DROP TABLE IF EXISTS `case_attach`;
CREATE TABLE `case_attach` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `cid` int(8) NOT NULL COMMENT 'case关联案例ID',
  `current_location` varchar(512) DEFAULT NULL COMMENT '当前位置节点（支持多节点）',
  `current_executor` varchar(512) DEFAULT NULL COMMENT '当前分配task operator（对应回当前节点location）',
  `template_id` varchar(64) NOT NULL COMMENT '关联的表单id，支持多个',
  `template_struct` text NOT NULL COMMENT '关联表单结构信息，支持多个',
  `form_data` text COMMENT '用户提交表单数据JSON',
  `version` varchar(8) DEFAULT NULL COMMENT '版本信息',
  `status` varchar(64) NOT NULL DEFAULT '0' COMMENT '0:未处理 1.完成',
  `builder` varchar(64) NOT NULL COMMENT '创建人',
  `create_time` int(12) NOT NULL COMMENT '创建日期时间戳格式',
  `last_update_time` int(12) NOT NULL COMMENT '最后修改时间戳',
  `final_modifier` varchar(64) NOT NULL COMMENT '最后修改者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=219 DEFAULT CHARSET=utf8 COMMENT='流程case附加记录表';

