-- ----------------------------
-- Table structure for case_management
-- ----------------------------
DROP TABLE IF EXISTS `case_management`;
CREATE TABLE `case_management` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `case_name` varchar(64) NOT NULL COMMENT '流程名称',
  `process_id` int(8) NOT NULL COMMENT '流程配置数据json存储',
  `form_circulation_sequence` varchar(512) NOT NULL COMMENT '表单循环流转次序（用于合并展示）',
  `current_location` varchar(512) DEFAULT NULL COMMENT '当前位置节点（支持多节点）',
  `current_executor` varchar(512) DEFAULT NULL COMMENT '当前执行者（对应回当前节点location）',
  `status` int(8) NOT NULL DEFAULT '0' COMMENT '0:未启动 1.进行中 2.挂起 3.非终点终结 9.finish',
  `history` text NOT NULL COMMENT '历史记录日志',
  `builder` varchar(64) NOT NULL COMMENT '创建人',
  `create_time` int(12) NOT NULL COMMENT '创建日期时间戳格式',
  `last_update_time` int(12) NOT NULL COMMENT '最后修改时间戳',
  `final_modifier` varchar(64) NOT NULL COMMENT '最后修改者',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=71 DEFAULT CHARSET=utf8 COMMENT='流程启动case表';

