DROP TABLE IF EXISTS `task_job`;
CREATE TABLE `task_job` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '编号id',
  `project_id` int(8) NOT NULL DEFAULT '0' COMMENT '项目id',
  `title` varchar(64) NOT NULL COMMENT '标题',
  `content` text NOT NULL COMMENT '内容',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '状态（1：添加未指派 2：激活 3：进行中 4：完成 5：关闭）',
  `test_status` int(2) NOT NULL DEFAULT '1' COMMENT '测试状态 (1：未测试 2：已通过 3：未通过)',
  `priority` int(2) NOT NULL COMMENT '任务优先级 （1：低 2：普通 3：高 4：紧急 5：立刻）',
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '类型（1：未知类型 2：需求 3：优化 4：bug）',
  `builder` varchar(64) NOT NULL COMMENT '创建人',
  `performer` varchar(64) NOT NULL COMMENT '指派人（执行者）',
  `follower` varchar(64) NOT NULL COMMENT '跟踪者',
  `progress` int(3) DEFAULT NULL COMMENT '任务完成的百分比',
  `spent_time` int(6) DEFAULT NULL COMMENT '任务登记耗时',
  `version` varchar(64) DEFAULT '' COMMENT '版本号',
  `start_time` datetime NOT NULL COMMENT '开始时间 Y-m-d H:i:s',
  `end_time` datetime NOT NULL COMMENT '结束时间 Y-m-d H:i:s',
  `estimated_hours` int(4) DEFAULT NULL COMMENT '预期花费时间',
  `create_time` int(12) NOT NULL COMMENT '创建日期时间戳格式',
  `pid` varchar(32) NOT NULL COMMENT '项目唯一id编号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

